    private fun printPic() {
        val mOptions = BitmapFactory.Options()
        mOptions.inScaled = false
       val bmp = BitmapFactory.decodeResource(resources, R.drawable.test, mOptions)
        printPicCode(bmp)
    }
private  fun printPicBase64(base64:String){
    val decodeByte = Base64.decode(base64, Base64.NO_WRAP)
    Log.e("TAG===>", "Byte: $decodeByte")
    val imageBit = BitmapFactory.decodeByteArray(decodeByte,0, decodeByte.size)
    Log.e("TAG===>", "Image: ${imageBit.width} // ${imageBit.height}")
    val W = (imageBit.width*2)+60
    val H = (imageBit.height*2)-160
    Log.e("TAG===>", "Width: $W")
    Log.e("TAG===>", "Height: $H")
    val newBitmap = Bitmap.createScaledBitmap(imageBit, W, H, true)
//    val newBitmap = Bitmap.createBitmap(
//        imageBit.getWidth(),
//        imageBit.getHeight(), imageBit.getConfig()
//    )
//    printPicCode(imageBit)
    printPicCodeBase64(newBitmap)
}
    /*
    print the text ,line and barcode
     */
    private fun printContent() {
        printer.sizeMm(60.0, 30.0)
            .gapInch(0.0, 0.0)
            .offsetInch(0.0)
            .speed(5.0)
            .density(10)
            .direction(TSPLConst.DIRECTION_FORWARD)
            .reference(20, 0)
            .cls()
            .box(6, 6, 378, 229, 5)
            .box(16, 16, 360, 209, 5)
            .barcode(30, 30, TSPLConst.CODE_TYPE_93, 100, TSPLConst.READABLE_LEFT, TSPLConst.ROTATION_0, 2, 2, "ABCDEFGH")
            .qrcode(265, 30, TSPLConst.EC_LEVEL_H, 4, TSPLConst.QRCODE_MODE_MANUAL, TSPLConst.ROTATION_0, "test qrcode")
            .text(200, 144, TSPLConst.FNT_16_24, TSPLConst.ROTATION_0, 1, 1, "Test EN")
            .text(38, 165, TSPLConst.FNT_16_24, TSPLConst.ROTATION_0, 1, 2, "HELLO")
            .bar(200, 183, 166, 30)
            .bar(334, 145, 30, 30)
            .print(1)
    }

    private fun printText() {
        printer.sizeMm(60.0, 30.0)
            .density(10)
            .reference(0, 0)
            .direction(TSPLConst.DIRECTION_FORWARD)
            .cls()
            .text(10, 10, TSPLConst.FNT_8_12, 2, 2, "123456")
            .print()
    }

    private fun printBarcode() {
        printer.sizeMm(60.0, 30.0)
            .gapMm(0.0, 0.0)
            .cls()
            .barcode(60, 50, TSPLConst.CODE_TYPE_128, 108, "abcdef12345")
            .print()
    }

    private fun printPicCode(b: Bitmap) {
        printer.sizeMm(76.0, 300.0)
            .cls()
            .bitmap(0, 0, TSPLConst.BMP_MODE_OVERWRITE, 600, b, AlgorithmType.Threshold)
            .print(1)
    }
    private fun printPicCodeBase64(b: Bitmap) {
        var width = b.width
        var height = b.height

        Log.e("TAG===>", "Width: $width")
        Log.e("TAG===>", "Height: $height")
        printer.sizeMm(width.toDouble(), height.toDouble())
            .cls()
            .bitmap(0, 0, TSPLConst.BMP_MODE_OVERWRITE, width, b, AlgorithmType.Threshold)
            .print(1)

    }
